Goal Representation:
def has_bowls_or_plates_in(item:item):
    symbol has_bowls_or_plates=exists o: item : (is_bowl(o) or is_plate(o)) and inside(o, item)
    return has_bowls_or_plates

behavior __goal__():
    body:
        if exists item: item : has_bowls_or_plates_in(item):
            bind item: item where:
                has_bowls_or_plates_in(item)
            achieve close_char(char, item)
        else:
            foreach item: item:
                if not visited(item):
                    observe(item,"Check if there are any bowls or plates inside")


def is_plate_or_bowl(item: item):
    symbol is_plate_or_bowl = is_plate(item) or is_bowl(item)
    return is_plate_or_bowl

behavior __goal__():
    body:
        if exists item: item : is_plate_or_bowl(item) and dirty(item):
            bind dish: item where:
                is_plate_or_bowl(dish) and dirty(dish)
            achieve visited(dish)
        else:
            foreach item: item:
                if is_plate_or_bowl(item) and not visited(item):
                    observe(item, "Check if it needs to be washed")
